import axios from "axios";
import React, { useEffect, useState } from "react";
import DataTable from "react-data-table-component";
import ArrowDownward from '@material-ui/icons/ArrowDownward';
import Paper from "@mui/material/Paper";
import paginationFactory from "react-bootstrap-table2-paginator";
import filterFactory , {textFilter} from "react-bootstrap-table2-filter";


const Sql2022 =() => {
    const sortIcon = <ArrowDownward />;
    const [search , setSearch] =useState("");
    const [data , setData] =useState([]);
    const [filterdData , setFilterdData] =useState([]);

const getData =async () => {

    try{
        const response = await axios.get("http://localhost:8082/release2022");
        setData(response.data);
        setFilterdData(response.data);
    } catch(err){
        console.log(err);
    }
};

const columns = [
    {
        name:"Knowledge Id",
        selector:(row) => row.knowledge_id,
        sortable:true,
        align: 'center',

    },

    {
        name:"Product Version Id",
        selector:(row) => row.product_version_id,
        sortable:true,
        align: 'center',
    },

    {
        name:"Knowledge Number",
        selector:(row) => row.knowledge_number,
        sortable:true,
        align: 'center',
        
    },

    {
      name:"Build Number",
      selector:(row) => row.build_number,
      sortable:true,
      align: 'center',
  },

  {
    name:"File Version",
    selector:(row) => row.file_version,
    sortable:true,
    align: 'center',
},

{
  name:"Release Date",
  selector:(row) => row.release_date,
  sortable:true,
  align: 'center',
  
},

{
  name:"Kb Url",
  selector:(row) => row.kb_url,
  sortable:true,
  align: 'center',
},

{
  name:"Kb Detail",
  selector:(row) => row.kb_detail,
  sortable:true,
  filter:textFilter(),
  align: 'center',
},


];

useEffect(()=>{
getData();

} ,[]);

useEffect(()=>{
    const result = data.filter(table => {
        return table.kb_url.toLowerCase().match(search.toLowerCase());
    });
    setFilterdData(result);
}, [search]);

return (

    <div class='Sqlfilter' responsive>
  <Paper>
  <center>
<DataTable  
title= <h3>SQL 2022</h3> 
 columns={columns} 
 data={filterdData}
 striped
 hover
 condensed
 responsive 
 pointerOnHover 
 pagination={paginationFactory}
 filter={filterFactory()}
 fixedHeader
 fixedHeaderScrollHeight="200px"
 highlightOnHover
 selectableRowsHighlight
 sortIcon={sortIcon}
//  progressComponent
 subHeader
 subHeaderComponent = {
    <input 
    type="text" 
    placeholder="Search Here" 
    className="w-25 form-control"
    subHeaderAlign="center"
    value={search}
    onChange={(e)=>setSearch(e.target.value)}
    />}  
    subHeaderAlign = "centre"
/>
</center>
</Paper>

</div>
);

};

export default Sql2022;
